import threading
import requests
import time
import json
from datetime import datetime, timedelta


api_key = ""
result_data_lock = threading.Lock()
start_time = time.time()


# summonerNames = []
def collect_summonerNames():
    summonerNames = []
    # # 1. 티어별 닉네임 조회 - challenger  -----------------------
    summoner_url = "https://kr.api.riotgames.com/lol/league/v4/challengerleagues/by-queue/RANKED_SOLO_5x5?api_key=" + api_key
    summoner_r = requests.get(summoner_url)

    callen_count = len(summoner_r.json()["entries"])

    for i in range(callen_count):
        summonerNames.append(summoner_r.json()["entries"][i]["summonerName"])
    return summonerNames
# 2. 티어별 puuid 조회 - challenger -----------------------
puuids = []
def fetch_puuid(summonerName):
    try:
        puuid_url = "https://kr.api.riotgames.com/lol/summoner/v4/summoners/by-name/" + str(summonerName) + "?api_key=" + api_key
        puuid = requests.get(puuid_url).json()["puuid"]

        with result_data_lock:
            puuids.append(puuid)
        return
    except Exception as e:
        return

def collect_puuids(summonerNames):
    puuid_threads = []
    for i in range(len(summonerNames)):

        if i % 50 == 0 and i > 0:
            # print("스레드의 개수: ",len(puuid_threads))
            # print("수집한 puuid의 개수: ", len(puuids))
            time.sleep(10)

        thread = threading.Thread(target=fetch_puuid, args=(summonerNames[i],))
        puuid_threads.append(thread)
        thread.start()

    # 모든 스레드가 종료될 때까지 대기
    for thread in puuid_threads:
        thread.join()
    puuid_list = puuids
    return puuid_list





